import React from "react";
import ReactDom from "react-dom";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" component="login" />
      </Switch>
    </Router>
  );
}

export default App;
